import React from "react";
import Cart from "../Cart/Cart";
import Services from "../services/Services";
import Company from "./Company";
import Contact from "./Contact";
import Navbar from "./Navbar";

const Client = () => {
  return (
    <div>
      <Navbar />
      <div class="flex mt-5">
        <div class="w-1/2">
          <Services />
        </div>
        <div class="w-1/2">
          <Company />
        </div>
      </div>
      <Cart/>
      <Contact />
    </div>
  );
};

export default Client;
